import React from 'react';
import { Col, Row } from 'antd';
import Navbar from '../components/Navbar'; // Asegúrate de que el camino sea correcto
import FooterComponent from '../components/footer'; // Si tienes un componente de footer
import { Link } from 'react-router-dom'; // importa Link

function Recibo() {
  return (
    <div className="background"> {/* Añadimos la clase background aquí */}
      <Row>
        <Col xs={24}>
          <Navbar />
        </Col>
      </Row>
      <Row style={{ padding: '20px' }}>
        <Col xs={24}>
          <div style={{ textAlign: 'center' }}>
            <Link to="/cartelera">
              {/* Aquí puedes agregar el contenido que desees */}
              <button 
                style={{ 
                  marginTop: '20px', 
                  padding: '10px 20px', 
                  backgroundColor: '#242424', 
                  color: '#fff', 
                  border: 'none', 
                  borderRadius: '4px' 
                }}
              >
                Volver a la cartelera
              </button>
            </Link>
          </div>
        </Col>
      </Row>
      <FooterComponent /> {/* Si tienes un footer, sino puedes omitir esta línea */}
    </div>
  );
}

export default Recibo;
